For sale Russian Army Special Forces "Spetsnaz" Survival Knife HB-1-01. 
The Russian Army Special Forces (Spetsnaz) were first created during the Cold War to carry out reconnaissance activities. Today, they are an extremely elite group with specialized training and missions. In fact, many believe they are the best of their kind in any military in the world. Their survival knife is designed for just that—survival. 

 Specifications:

Length:                            330mm

Width:                                61mm

Height:                               50mm

Blade length:                   160mm

Blade width:                      30mm

Blade thickness:                 4mm

Saw length:                      100mm

Weight of complete set:  0.75kg

 A complete set of the Survival Knife includes the main assembly units and parts:

 Knife with handle assembly;

Compass assembly;

Casing assembly

Saw;

Light knife;

Cord line;
Fishing line;

Cotton thread;

Needle for sewing;

Fish hook; #8.5;

“Drobinka” lead sinker;

Pin;

Coil for fishing line and thread;

Container;

Container cap.
